import React from 'react';
import './css/Photo.css';

const Photographs = () => {
  const photos = [
    { url: 'photo1.jpg', alt: 'Photograph 1', link: '/photograph1' },
    { url: 'photo2.jpg', alt: 'Photograph 2', link: '/photograph2' },
    { url: 'photo3.jpg', alt: 'Photograph 3', link: '/photograph3' },
    { url: 'photo4.jpg', alt: 'Photograph 4', link: '/photograph4' },
    { url: 'photo5.jpg', alt: 'Photograph 5', link: '/photograph5' },
    { url: 'photo6.jpg', alt: 'Photograph 6', link: '/photograph6' },
    { url: 'photo7.jpg', alt: 'Photograph 7', link: '/photograph7' },
    { url: 'photo8.jpg', alt: 'Photograph 8', link: '/photograph8' },
    { url: 'photo9.jpg', alt: 'Photograph 9', link: '/photograph9' },
    { url: 'photo10.jpg', alt: 'Photograph 10', link: '/photograph10' },
  ];

  return (
    <div className="photographs-container">
      <div className="cards">
        <ul>
          {photos.map((photo, index) => (
            <li key={index} onClick={() => window.location.href=photo.link}>
              <img src={photo.url} alt={photo.alt} />
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Photographs;
